    let bid_left_A = $("#barter-tokens-tokens-sell").val();
    let bid_right_A = $("#barter-tokens-tokens-buy").val();
    let bid_left_B = $("#barter-tokens-secure-sell").val();
    let bid_right_B = $("#barter-tokens-secure-buy").val();

